def setServoStatesLegs(feet_positions, force, jointDamping):
    tp = calculateIK3(feet_positions, jointDamping)
    p.setJointMotorControlArray(
        hexapod_ID,
        JOINT_INDICES,
        p.POSITION_CONTROL,
        targetPositions=tp,
        forces=([force] * 18)
    )


